{'52383',	'太宗者字穀飛號牛棚居士益州廣安府人。初從太祖後郃脩養自謂三落而起。太祖既崩，迺與葉謀，許葉與嶺南，稱粵王；與秣陵與許，稱越王；又封震於陝塬以西，稱秦王。剪兩凣黨羽而廢之，遂登大寶，改元改開，自許天下共主人心所曏。太宗閑時，嚐謂之左右：“貓之優劣，以皮毛黑白而辯乎？唯捕鼠耳～”左右皆曰：善！嚐乗倭國黑思必銳歐，與譯者曰：乗此座有逐日而行足不濺地催人疾走之意，衆人聞之皆笑。壹壹節選 自@燿中懷仁 《史記新編．太宗本紀捲壹》',	'太宗者字穀飛號牛棚居士益州廣安府人。初從太祖後郃脩養自謂三落而起。太祖既崩，迺與葉謀，許葉與嶺南，稱粵王；與秣陵與許，稱越王；又封震於陝塬以西，稱秦王。剪兩凣黨羽而廢之，遂登大寶，改元改開，自許天下共主人心所曏。太宗閑時，嚐謂之左右：“貓之優劣，以皮毛黑白而辯乎？唯捕鼠耳～”左右皆曰：善！嚐乗倭國黑思必銳歐，與譯者曰：乗此座有逐日而行足不濺地催人疾走之意，衆人聞之皆笑。壹壹節選 自@燿中懷仁 《史記新編．太宗本紀捲壹》'},
{'52384',	'太宗者字谷飞号牛棚居士益州广安府人。初从太祖后合修养自谓三落而起。太祖既崩，乃与叶谋，许叶与岭南，称粤王；与秣陵与许，称越王；又封震于陕塬以西，称秦王。剪两凡党羽而废之，遂登大宝，改元改开，自许天下共主人心所向。太宗闲时，尝谓之左右：“猫之优劣，以皮毛黑白而辩乎？唯捕鼠耳～”左右皆曰：善！尝乘倭国黑思必锐欧，与译者曰：乘此座有逐日而行足不溅地催人疾走之意，众人闻之皆笑。一一节选 自@耀中怀仁 《史记新编．太宗本纪卷一》',	'太宗者字谷飞号牛棚居士益州广安府人。初从太祖后合修养自谓三落而起。太祖既崩，乃与叶谋，许叶与岭南，称粤王；与秣陵与许，称越王；又封震于陕塬以西，称秦王。剪两凡党羽而废之，遂登大宝，改元改开，自许天下共主人心所向。太宗闲时，尝谓之左右：“猫之优劣，以皮毛黑白而辩乎？唯捕鼠耳～”左右皆曰：善！尝乘倭国黑思必锐欧，与译者曰：乘此座有逐日而行足不溅地催人疾走之意，众人闻之皆笑。一一节选 自@耀中怀仁 《史记新编．太宗本纪卷一》'},
